import React, { useState, useEffect } from "react";
import Commits from "./Commits";
import Repositories from "./Repositories";
import Details from "./Details";
import Lines from "./Lines"


const User = ({ user }) => {
    const [ready, setReady] = useState(true)
    const [ready2, setReady2] = useState(true)
    const [ready3, setReady3] = useState(true)
    const [repo, setRepo] = useState('')
    const [url, setUrl] = useState('')
    const [tree_sha, setTree] = useState('')
    const [lines, setLines] = useState('')

    const getReady = (commit_url, repo) => (e) => {
		e.preventDefault()
		setReady(false)
        setUrl(commit_url)
        setRepo(repo)
	}

    const getReady2 = (tree_sha) => (e) => {
        e.preventDefault()
		setReady2(false)
        setTree(tree_sha)
    }

    const getReady3 = (url) => (e) => {
        setLines(url)
    }

    const show = () => {
        if (ready)
            return <div><Repositories user = { user } getReady = { getReadyÂ }/></div>
        else
            if (ready2)
                return <Commits url = { url } getReady2 =  {getReady2} />
            else
                if (ready3)
                    return <Details user = { user } repo = { repo } url = { tree_sha } getReady3 = { getReady3 }/>
                else
                    return <Lines url = { lines } />
    }
    return(
        <div>
            { show() }
        </div>
    )
}


export default User
